1- User has to Download Postman

2- The user has to create an Account for Admin and NewDashboard

3- Configure Wallets

4- Add funds to the account

5- Perform a Login using&nbsp;https://admin.qawyre.com/ajax/core/v2/sessions/auth
&nbsp;&nbsp; with body as: {&quot;password&quot;:&quot;Password&quot;,&quot;email&quot;:&quot;Email&quot;,&quot;token&quot;:&quot;7cc5acc81aa6e2807923b89ac25e90a8&quot;}

6- From Response extract the session Id as: &quot;sessionId&quot;: &quot;38FEPFMAWT34DGCYEDVD9DN43J6ZENUG49DZWUFLQAE9D&quot;

7- Go to the Request for transfers and perform the Action

8- From request, Login Use the Session-Id and Account&nbsp;
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
